import React from "react";


function forget (){

    return(
        <div>
        <label>Select security question</label>
        <select
            name="security question"
            type="option"
            placeholder="security question">
            <option defaultValue>Select sequrity question</option>
            <option value="which is your favourite place">which is your favourite place</option>
            <option value="Surname of favourite teacher">sirname of favourite teacher</option>
            <option value="First pet name">First pet name</option>
        </select>
        </div>

    )
}

export default forget;
